public void init()
{
    super();
    this.queryBuildDataSource().clearDynalinks();
			// Musab - Making prinicipal procedure code mandatory based on medical coding checkbox
			// Start: 
    if (HMBillParameters::find().IsMedicalCodingMandatory == NoYes::Yes)
    {
        HMCase_ds.object(fieldNum(hmCase, PrincipalProcedureCode)).mandatory(true);
			} 
			// End.
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllCaseOpenStatusMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMCase)).addRange(fieldNum(HMCase,CaseStatus)).value(SysQuery::value(HMCaseStatus::Open));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllCaseOnHoldStatusMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMCase)).addRange(fieldNum(HMCase,CaseStatus)).value(SysQuery::value(HMCaseStatus::OnHold));
    }
    if (element.args().menuItemName() == menuItemDisplayStr(HMAllCaseClosedStatusMenuItem))
    {
        this.query().dataSourceTable(tableNum(HMCase)).addRange(fieldNum(HMCase,CaseStatus)).value(SysQuery::value(HMCaseStatus::Closed));
    }

}

