public void init()
{
    QueryBuildDataSource qbdsCustTable;

    super();
    qbdsCustTable = this.query().dataSourceTable(tableNum(CustTable));

    qbdsCustTable.relations(false);

    qbdsCustTable.joinMode(JoinMode::OuterJoin);

    qbdsCustTable.clearLinks();

    qbdsCustTable.clearRanges();

    qbdsCustTable.addLink(fieldnum(HMPatient, CustTable),fieldnum(CustTable, RecId));
}

